import React from "react";

function About() {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "Right",
        alignItems: "Right",
        height: "100vh",
      }}
    >
      <h1>About Us</h1>
    </div>
  );
}

export default About;
